import React from 'react'
import Header from './Header';
import Home from './Home';
import About  from './About';
import Footer from './Footer';
import CourseDetail from './CourseDetail';
import TeacherDetail from './TeacherDetail';

//Teacher
import TeacherRegister from './Teacher/TeacherRegister';
import TeacherLogin from './Teacher/TeacherLogin';
import TeacherDashboard from './Teacher/TeacherDashboard';
import TeacherCourses from './Teacher/TeacherCourses';
import TeacherProfileSetting from './Teacher/TeacherProfileSetting';
import TeacherChnagePassword from './Teacher/TeacherChangePassword';
import AddCourse from './Teacher/AddCourse';
import UserList from './Teacher/UserList';
import TeacherLogout from './Teacher/TeacherLogout';
import AddChapter from './Teacher/AddChapter';
import CourseChapter from './Teacher/CourseChapter';
import EditChapter from './Teacher/EditChapter';
import EditCourse from './Teacher/EditCourse';
import TeacherSkillsCategory from './TeacherSkillsCategory'; 
import EnrolledStudents from './Teacher/EnrolledStudents';

//Student
import Register from './User/Register';
import Login from './User/Login';
import Logout from './User/Logout';
import Dashboard from './User/Dashboard';

import MyCourses from './User/MyCourses';
import FavoriteCourses from './User/FavoriteCourses';
import RecommendedCourses from './User/RecommendedCourses';
import ProfileSetting from './User/ProfileSetting';
import ChnagePassword from './User/ChangePassword';

import {Routes as Switch,Route} from 'react-router-dom';


//All Courese
import AllCourses from './AllCourses';
import PopularCourses from './PopularCourses';
import PopularTeachers from './PopularTeachers';
import CategoryCourses from './CategoryCourses';


//Training
import TrainingDashboard from './Training/TrainingDashboard';
import TrainingDetails from './Training/TrainingDetails';

function Main() {
    return (
      <div className="App">
        <Header />

        <Switch>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/detail/:course_id" element={<CourseDetail />} />
          <Route path="/teacher-detail/:teacher_id" element={<TeacherDetail />} />


          {/*Trainer */}
          <Route path="/teacher-login" element={<TeacherLogin />} />
          <Route path="/teacher-logout" element={<TeacherLogout />} />
          <Route path="/teacher-register" element={<TeacherRegister />} />
          <Route path="/teacher-dashboard/:teacher_id" element={<TeacherDashboard />} />
          <Route path="/teacher-courses" element={<TeacherCourses />} />
          <Route path="/add-course" element={<AddCourse />} />
          <Route path="/edit-course/:course_id" element={<EditCourse />} />
          <Route path="/teacher-users" element={<UserList />} />
          <Route path="/add-chapter/:course_id" element={<AddChapter />} />
          <Route path="/all-chapters/:course_id" element={<CourseChapter />} />
          <Route path="/edit-chapter/:chapter_id" element={<EditChapter />} />
          <Route path="/teacher-profile-setting" element={<TeacherProfileSetting />} />
          <Route path="/teacher-change-password" element={<TeacherChnagePassword />} />
          <Route path="/enrolled-students/:course_id" element={<EnrolledStudents />} />


          {/*Student */}
          <Route path="/user-login" element={<Login />} />
          <Route path="/user-logout" element={<Logout />} />
          <Route path="/user-register" element={<Register />} />
          <Route path="/user-dashboard" element={<Dashboard />} />
          <Route path="/my-courses" element={<MyCourses />} />
          <Route path="/favorite-courses" element={<FavoriteCourses />} />
          <Route path="/recommended-courses" element={<RecommendedCourses />} />
          <Route path="/profile-setting" element={<ProfileSetting />} />
          <Route path="/change-password" element={<ChnagePassword />} />


          {/* All Courses */}
          <Route path="/all-courses" element={<AllCourses />} />
          <Route path="/popular-courses" element={<PopularCourses />} />
          <Route path="/popular-teachers" element={<PopularTeachers />} />
          <Route path="/category/:category_slug" element={<CategoryCourses />} />
          <Route  path="/teacher-skill-courses/:skill_name/:teacher_id" element={<TeacherSkillsCategory />} />

          {/* Traing */}
          <Route path="/trainer-dashboard/:teacher_id" element={<TrainingDashboard />} />
          <Route path="/training-details/:teacher" element={<TrainingDetails />} />


        </Switch>
        <Footer/>
      </div>
    );
  }

  export default Main;
